import './App.css';
import Title from './Components/Title';
import About from './Components/About';
import Mid from './Components/Mid';

function App() {

  
  return (

    <div className="App">
      <Title/>
      <Mid />
      <Mid />
      <About/>
    </div>
  );
}

export default App;
